create table exp_krit_zag
(
    id    numeric not null
        constraint exp_krit_zag_pk
            primary key,
    zag   varchar(10),
    krit  varchar(2000),
    vid   integer,
    mkb   varchar(200),
    typ   varchar(200),
    vz    varchar(10),
    st1   varchar(20),
    phase integer
);

alter table exp_krit_zag
    owner to exp_user;

create unique index exp_krit_zag_id_uindex
    on exp_krit_zag (id);

